import React, { useState } from "react";
import myData from "../data.json";




const Idahodata = () => {
    myData.map(dataIn => {
    return (
          <div className="data">
               {dataIn.IdahoproList.map(idaho => ( 
                     <h1>{idaho.name}</h1>
               ))}
          </div>
      )
    })
};
export default Idahodata;
